import React, { useState, useRef } from 'react';
import { Input } from 'antd';
import { SearchOutlined } from '@ant-design/icons';
import { RouteProps } from 'react-router-dom';

interface searchBarProps {
	history: RouteProps;
}

const Searchbar: React.FC<searchBarProps> = ({ history }) => {
	const [query, setQuery] = useState('');
	const searchForm = useRef(null);

	// console.log(history);
	const handlerSearch = (event: React.FormEvent<HTMLFormElement>) => {
		event.preventDefault();

		console.log(event);
		// console.log(event);
	};
	window.search = searchForm;
	const searchInputEvent = (event: React.ChangeEvent<HTMLInputElement>) => {
		// console.log(event.target.value);

		console.log(event.target);
	};

	return (
		<div className='gi_width_res'>
			<form onSubmit={handlerSearch} ref={searchForm}>
				<Input
					size='large'
					prefix={<SearchOutlined className='searchIcon' />}
					placeholder='Search...'
					className='searchBar'
					type='Search'
					onChange={searchInputEvent}
				/>
			</form>
		</div>
	);
};

export default Searchbar;
